import React from "react";
import { Table } from "reactstrap";

export const ResultTable = (props) => {
  const headers = ["Name", "Title", ]
  return <Table>
    <thead>
      <tr>
        <th>#</th>
        <th onClick={() => props.onClick("name")}>First Name</th>
        <th>Last Name</th>
        <th>Username</th>
      </tr>
    </thead>
    <tbody>
      {props.results ? props.results.map((result, id) => <Row data={result} id={id + 1} />) : ""}
    </tbody>
  </Table>
}

export const Row = (props) => {
  return <tr><td>{props.id}</td><td>{props.data.name.first}</td></tr>

}
